end
return false Once you have made these changes, hit ctrl-s to save your game and ctrl-r to run it. You will want to test to verify that all of the sprite types work. That means you will want to: Attempt to walk into all wall tile types (e.g. water, wall) Pick up all key tile types (e.g. the key and the chest) Step on all spike tile types Walk on all non-wall types (e.g. grass, stone) If a tile isn't behaving as you expect, double check that the number for the sprite is in the correct list in map_setup.

