}) Next, we add a box to our bullets. If a bullet's box intersects with an enemy's box, the enemy should receive damage or be destroyed. Bullets are destroyed by the impact. function fire() local b={ sp=3, x=ship.x, y=ship.y, dx=0, dy=-3, box={x1=2,y1=0,x2=5,y2=4} } add(bullets,b)
end This bounding box is smaller than the one for either enemies or the ship since the bullet doesn't fill its tile. The function abs_box goes above the placeholder coll function we added in the last step. The box properties we added just tell us the size of the box. To actually compute whether two objects on screen intersect, we need the pixel coordinates of the box. That is what this function does. It adds an object's x and y coordinates to the box's properties. It translates from the relative coordinates of the box to its absolute coordinates. function abs_box(s) local box={} box.x1=s.box.x1+s.x box.y1=s.box.y1+s.y box.x2=s.box.x2+s.x box.y2=s.box.y2+s.y return box
end This next change sets us up for calculating whether there was a collision between two boxes. It takes two entities (A and B) and gets the screen coordinates of the bounds of their bounding box . function coll(a, b) --todo box_a=abs_box(a) box_b=abs_box(b)
end What do we have to show for all that typing? Nothing (just yet), at least, not that we can see visually. We did plenty conceptually. We added bounding boxes to our ship, enemies, and bullets. We can compute the absolute (screen) coordinates of the bounding box for one of these entities. We also updated our coll function to compute the bounding box for two different entities which will be used to start causing damage to the ship, enemies, and bullets.

